            7
        </Button>

        <Button onClick={() => console.log(3)}
        className='5'
        >
            8
        </Button>

        <Button onClick={() => console.log(3)}
        className='5'
        >
            9
        </Button>

    </div>

 const Button = ({onClick, className= '', children}) =>
    <button
        onClick={onClick}
        className={className}
        type="button"
        >
        {children}
        </button>





